data.value:
Specify the format for naming objects in the handlebars format, specifying the arguments in double curly braces, where the arguments are:
{{n}} - number;
{{displayname}} - display name;

The variables used are: {{n}} - number; {{displayname}} - display name;
Used functions: {{lz number data}} - add (number) leading zeros to (data) {{lz 5 n}} = 00777
{{fst number data}} - take the first (number) characters (data) {{fst 3 displayname}} = Arn [old Alois Schwarzenegger]
{{trans data}} - transliteration into the Latin alphabet {{trans displayname}} = ivanov ivan ivanovich
{{split 2 displayname}} = Alois
Combinations: {{fst 1 (trans (split 1 displayname))}}. {{trans (split 0 displayname)}}
